description:
sự kiện bốc thăm trúng thưởng diễn ra vào sáng thứ 7 ngày 18 tháng 11 năm 2023.
thời gian diễn ra sự kiện: 8h00 đến 11h30
địa điểm: nhà mẫu hoang huy commerce đối diện 730 thiên lôi, lê chân, hải phòng.
điều kiện để khách hàng nhận phiếu bttt:
- khách hàng đặt cọc mua căn hộ dự án hoang huy commerce giai đoạn từ 11/09 đến 18/11/2023.
- mỗi căn hộ ký hợp đồng 01 căn hộ dự án hoang huy commerce sẽ nhận được 01 phiếu bttt;


điều kiện để khách hàng nhận thưởng tại sự kiện bttt:
- khách hàng phải kí hđmb theo đúng quy định thời gian của chủ đầu tư và thanh toán tối thiểu 15% giá trị hợp đồng;
- khi nhận giải thưởng, khách hàng phải có đầy đủ cccd, phiếu bttt còn nguyên vẹn không xước, phai, nhòe, gãy gập, mất góc;
- phiếu bttt có giá trị tiền mặt tương đương;
*lưu ý: trường hợp khách hàng bận không thể tới tham dự sự kiện bttt thì có thể ủy quyền cho 1 người khác tới tham dự. khách hàng có thể gửi ủy quyền bốc thăm qua email của cđt là: info@hoanghuy-commerce.vn hoặc nhắn số điện thoại zalo 0779 321 588 nội dung ủy quyền kèm theo cccd của người được ủy quyền tham dự bốc thăm.
